function encodeSingleAndDoubleQuotes(A){if(A==null){return A;}var B=A;B=B.replace('"',"&quot;");B=B.replace("'","&#39;");return B;}function trimStringLeft(D){if(D==null){return D;}if(D.length==0){return D;}var A=D;var B=A.length;var E=-1;for(var C=0;C<B;C++){if(A.charAt(C)==" "){E+=1;}else{break;}}if(E>=0){A=A.substring(E+1,B-E-1);
}return A;}function trimStringRight(D){if(D==null){return D;}if(D.length==0){return D;}var A=D;var B=A.length;var E=B;for(var C=B-1;C>=0;C--){if(A.charAt(C)==" "){E-=1;}else{break;}}if(E<B){A=A.substring(0,E);}return A;}function trimString(B){var A=B;A=trimStringLeft(A);A=trimStringRight(A);return A;
}function compareStringsIgnoreBlankSpaces(A,G){if(A==null&&G==null){return 0;}if(A==null&&G!=null){return -1;}if(A!=null&&G==null){return 1;}var C=trimString(A);var B=trimString(G);var F=C.length;var E=B.length;if(F!=E){if(F>E){return 1;}else{return -1;}}for(var D=0;D<F;D++){if(C.charAt(D)!=B.charAt(D)){if(C.charAt(D)>B.charAt(D)){return 1;
}else{return -1;}}}return 0;}